import Api from "./Api";

const UserApi = async (data) => {
  try {
    const result = await Api("/login", {
      method: "POST",
      headers: {
        "content-type": "application/json",
      },

      data: data,
    });

    return result;
  } catch (error) {
    return error.response.data;
  }
};

export default UserApi;
